import React from "react";

const Events = () => {
  return (
    <div className="events">
      <div className="container">
        <h2>Upcoming Events</h2>
        <ul>
          <li>Event 1 - Date</li>
          <li>Event 2 - Date</li>
          <li>Event 3 - Date</li>
        </ul>
      </div>
    </div>
  );
};

export default Events;
